  \"2013-03-19T00:33:04.526074\",\n\t\"name\": \"40ar-39ar-ages-from-the-selawik-a-2-a-3-and-a-4-and-candle-b-5-quadrangles-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"40Ar/39Ar data from seven plutonic samples
  and one metamorphic sample collected during mineral assessment studies in 1991 show
  that various rock units in the Selawik Hills plutonic complex were emplaced in the
  order syenite/monzonite (nonfoliated, 106.6 u00c2u00b1 0.8 Ma; foliated, 101.7 u00c2u00b1
  0.7 Ma; both on hornblende), followed by nepheline syenite (103.7 u00c2u00b1 0.8
  Ma on hornblende) and then quartz monzonite (100.4 u00c2u00b1 3.7 Ma on biotite).
  40Ar/39Ar data from Granite Mountain hornblendes yielded ages slightly older, but
  overlapping, those from Selawik Hills. In this suite, the silica-undersaturated
  phase appears to be younger (105.7 u00c2u00b10.8 Ma) than the silica-saturated phase(s)
  (106.8 u00c2u00b1 0.8 Ma and 107.1 u00c2u00b1 0.8 Ma).\",\n\t\"license_title\":
